	/**
	 * Returns all keywords of the grammar. This includes all literals for boolean and
	 * enumeration terminals.
	 */
	public Set<String> getKeywords() {
		if (this.keywords == null) {
			this.keywords = new LinkedHashSet<String>();
			for (org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolRule rule : RULES) {
				findKeywords(rule, this.keywords);
			}
		}
		return keywords;
	}
	
	/**
	 * Finds all keywords in the given element and its children and adds them to the
	 * set. This includes all literals for boolean and enumeration terminals.
	 */
	private void findKeywords(org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolSyntaxElement element, Set<String> keywords) {
		if (element instanceof org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolKeyword) {
			keywords.add(((org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolKeyword) element).getValue());
		} else if (element instanceof org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolBooleanTerminal) {
			keywords.add(((org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolBooleanTerminal) element).getTrueLiteral());
			keywords.add(((org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolBooleanTerminal) element).getFalseLiteral());
		} else if (element instanceof org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolEnumerationTerminal) {
			org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolEnumerationTerminal terminal = (org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolEnumerationTerminal) element;
			for (String key : terminal.getLiteralMapping().keySet()) {
				keywords.add(key);
			}
		}
		for (org.servicifi.gelato.language.cobol.resource.cobol.grammar.CobolSyntaxElement child : element.getChildren()) {
			findKeywords(child, this.keywords);
		}
	}
	
